CREATE TABLE ipl(id INTEGER PRIMARY KEY AUTO_INCREMENT, season INTEGER  NOT NULL, city VARCHAR(20), dates DATE NOT NULL, team1 VARCHAR(50) NOT NULL, team2 VARCHAR(50) NOT NULL, toss_winner VARCHAR(50) NOT NULL, toss_decision VARCHAR(10) NOT NULL, result VARCHAR(10) NOT NULL, dl_applied INTEGER NOT NULL, winner VARCHAR(50), win_by_runs INTEGER NOT NULL, win_by_wickets INTEGER NOT NULL, player_of_match VARCHAR(20), venue VARCHAR(100) NOT NULL, umpire1 VARCHAR(30), umpire2 VARCHAR(30), umpire3 VARCHAR(30));
